          </div>

          {/* Navigation Buttons */}
          <div style={{
            display: 'flex',
            gap: '12px'
          }}>
            <button
              onClick={() => setCurrentView('subexecution')}
              style={{
                padding: '10px 20px',
                borderRadius: '8px',
                border: 'none',
                backgroundColor: currentView === 'subexecution' ? '#9755fe' : 'transparent',
                color: '#ffffff',
                fontSize: '14px',
                fontWeight: '600',
                cursor: 'pointer',
                transition: 'all 0.2s',
                display: 'flex',
                alignItems: 'center',
                gap: '8px'
              }}
              onMouseEnter={(e) => {
                if (currentView !== 'subexecution') {
                  e.currentTarget.style.backgroundColor = 'rgba(151, 85, 254, 0.2)';
                }
              }}
              onMouseLeave={(e) => {
                if (currentView !== 'subexecution') {
                  e.currentTarget.style.backgroundColor = 'transparent';
                }
              }}
            >
              <span>ðŸŽ¯</span>
              <span>Ranking SubexecuÃ§Ã£o</span>
            </button>

            <button
              onClick={() => setCurrentView('anomaly')}
              style={{
                padding: '10px 20px',
                borderRadius: '8px',
                border: 'none',
                backgroundColor: currentView === 'anomaly' ? '#9755fe' : 'transparent',
                color: '#ffffff',
                fontSize: '14px',
                fontWeight: '600',
                cursor: 'pointer',
                transition: 'all 0.2s',
                display: 'flex',
                alignItems: 'center',
                gap: '8px'
              }}
              onMouseEnter={(e) => {
                if (currentView !== 'anomaly') {
                  e.currentTarget.style.backgroundColor = 'rgba(151, 85, 254, 0.2)';
                }
              }}
              onMouseLeave={(e) => {
                if (currentView !== 'anomaly') {
                  e.currentTarget.style.backgroundColor = 'transparent';
                }
              }}
            >
              <span>ðŸš¨</span>
              <span>AnÃ¡lise de Anomalias</span>
            </button>

            <button
              onClick={() => setCurrentView('main')}
              style={{
                padding: '10px 20px',
                borderRadius: '8px',
                border: 'none',
                backgroundColor: currentView === 'main' ? '#9755fe' : 'transparent',
                color: '#ffffff',
                fontSize: '14px',
                fontWeight: '600',
                cursor: 'pointer',
                transition: 'all 0.2s',
                display: 'flex',
                alignItems: 'center',
                gap: '8px'
              }}
              onMouseEnter={(e) => {
                if (currentView !== 'main') {
                  e.currentTarget.style.backgroundColor = 'rgba(151, 85, 254, 0.2)';
                }
              }}
              onMouseLeave={(e) => {
                if (currentView !== 'main') {
                  e.currentTarget.style.backgroundColor = 'transparent';
                }
              }}
            >
              <span>ðŸ“ˆ</span>
              <span>Dashboard Principal</span>
